import styled from "styled-components";

const SideNavStyled = styled.nav`
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: gray;
  align-contents: space-between;
  width: 23vw;
  height: 57em;
  position: sticky;
  top: 0;
  padding: 10px;
`;

export default SideNavStyled;
